import React, { useState } from 'react';
import { Box, TextField, Button, Grid } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import DownloadIcon from '@mui/icons-material/Download';

const initialFilters = {
  circuit_id: '',
  outage_tickets_last_30d: '',
  maintenance_tickets_last_30d: '',
  kmz_file_path: '',
  live_latency: '',
  expected_latency: '',
  test_results_link: '',
  cable_system: '',
  is_special: '',
  underlying_carrier: '',
  location_a: '',
  location_b: '',
  bandwidth: '',
  more_details: ''
};

function SearchExportBar({ onSearch, onExport }) {
  const [filters, setFilters] = useState(initialFilters);

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const handleSearch = () => {
    onSearch(filters);
  };

  return (
    <Box sx={{ mb: 2 }}>
      <Grid container spacing={1} alignItems="center">
        {Object.keys(initialFilters).map((key) => (
          <Grid item key={key}>
            <TextField
              size="small"
              label={key.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
              name={key}
              value={filters[key]}
              onChange={handleChange}
              variant="outlined"
            />
          </Grid>
        ))}
        <Grid item>
          <Button variant="contained" color="primary" startIcon={<SearchIcon />} onClick={handleSearch}>
            Search
          </Button>
        </Grid>
        <Grid item>
          <Button variant="outlined" color="secondary" startIcon={<DownloadIcon />} onClick={onExport}>
            Export CSV
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
}

export default SearchExportBar;
